                   '</g>' +
                   '<defs>' +
                   '<clipPath id="clip0_2839_52564">' +
                   '<rect width="20" height="20" fill="white"/>' +
                   '</clipPath>' +
                   '</defs>' +
                   '</svg>';
        default:
            return '<svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">' +
                   '<circle cx="10" cy="10" r="6" fill="#AAAAAA"/>' +
                   '</svg>';
    }
}

function getStateLabel(state) {
    switch(state) {
        case 'false':
            return 'Disconnesso';
        case 'true':
            return "Attivo";
        case 'critical':
            return 'Critical';
        case 'major':
            return 'Major';
        case 'normal':
            return 'Normal';
        case 'disconnected':
            return 'Disconnected';
        default:
            return state;
    }
}

